import React from "react";

import Search from "./Sections/Search.jsx";
import Filters from "./Sections/Filters.jsx";

export default function FilterSection({ title }) {
  return (
    <>
      <div className="right">
        <Search title={title} />

        <Filters title={title} />

        <div className="left-section recientes">
          <h3 className="left-title">
            <span>{title}</span> Recientes
          </h3>
        </div>
      </div>
    </>
  );
}
